import React from "react";
import ReactLoading from "react-loading";

const Loading = () => {
  return (
    <div style={{marginTop:"10%", marginLeft:"25%"}}>
      <ReactLoading
        type="spinningBubbles"
        color="#8b3eea"
        height={100}
        width={50}
      />
    </div>
  );
};

export default Loading;
